const stylee = ({ ID }) => {
  function styleee() {
    if (ID === "LogIn" || ID === "Get Started" || ID === "View More" || ID === 3) {
      return {
        borderRadius: "6px",
        background: "#74BDE0",
        color: "White",
        fontFamily: "Poppins",
        fontSize: "20px",
        fontWeight: "500",
      };
    } 
    else if (ID === "Get Quote" || ID === "Live Chat" || ID === "Chat With Us") {
      return {
        width: "150px",
        height: "56px",
        borderRadius: "6px",
        border: "1px solid #74BDE0",
        color: "#74BDE0",
        fontFamily: "Poppins",
        fontSize: "20px",
        fontWeight: "500",
        marginLeft: "15px",
      };
    }
  }

  return styleee;
};

export default stylee;
